import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p id="testArea">
          Test
        </p>
      </header>
    </div>
  );
}

let jsonReq = new XMLHttpRequest;
jsonReq.open("GET", "https://na1.api.riotgames.com/lol/summoner/v4/summoners/by-name/pvleviathan");
jsonReq.setRequestHeader("X-Riot-Token", "RGAPI-652b0d79-880e-4cad-98d9-baf65cf48ec4");
jsonReq.send();

export default App;
